```python
def gcf(a, b):
    # Check if either number is zero
    if a == 0 or b == 0:
        return 0

    # Iterate through factors of a
    for i in range(1, a + 1):
        if a % i == 0:
            # If i is also a factor of b, it is the GCF
            if b % i == 0:
                return i

    # If no common factor is found, return the larger number
    return max(a, b)
```

This function works by iterating through all the factors of the first number, `a`, and checking if each factor is also a factor of the second number, `b`. If a factor is found that is common to both numbers, it is returned as the greatest common factor. If no common factor is found, the larger of the two numbers is returned.

